// Skills.js
import React from "react";
import "./Skills.css";

import {
  FaHtml5, FaCss3Alt, FaJs, FaPython, FaJava, FaReact, FaNodeJs,
  FaAws, FaGitAlt, FaGithub, FaAndroid, FaFigma
} from "react-icons/fa";

import {
  SiExpress, SiMongodb, SiPostma, SiCanva, SiDart
} from "react-icons/si";

import { TbBrain } from "react-icons/tb"; // For Machine Learning
import { AiOutlineEye } from "react-icons/ai"; // For CV/NLP

const skills = [
  { name: 'HTML', icon: <FaHtml5 /> },
  { name: 'CSS', icon: <FaCss3Alt /> },
  { name: 'JavaScript', icon: <FaJs /> },
  { name: 'Python', icon: <FaPython /> },
  { name: 'Java', icon: <FaJava /> },
  { name: 'Dart', icon: <SiDart /> },
  { name: 'React', icon: <FaReact /> },
  { name: 'React Native', icon: <FaReact /> },
  { name: 'Node.js', icon: <FaNodeJs /> },
  { name: 'Express', icon: <SiExpress /> },
  { name: 'Machine Learning', icon: <TbBrain /> },
  { name: 'Deep Learning', icon: <TbBrain /> },
  { name: 'Natural Language Processing', icon: <AiOutlineEye /> },
  { name: 'Computer Vision', icon: <AiOutlineEye /> },
  { name: 'AWS', icon: <FaAws /> },
  { name: 'Git', icon: <FaGitAlt /> },
  { name: 'GitHub', icon: <FaGithub /> },
  { name: 'Postman', icon: <SiPostman /> },
  { name: 'Android Studio', icon: <FaAndroid /> },
  { name: 'VS Code', icon: <SiVscode /> },
  { name: 'Figma', icon: <FaFigma /> },
  { name: 'Canva', icon: <SiCanva /> },
];

const Skills = () => {
  return (
    <section className="skills-section" id="skills">
      <h2>My Skills</h2>
      <div className="skills-grid">
        {skills.map((skill, index) => (
          <div className="skill-item" key={index}>
            <div className="skill-icon">{skill.icon}</div>
            <span>{skill.name}</span>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Skills;
